(1999, 112, 'substance_abuse_top', '<a href="http://www.cdc.gov/msmhealth/substance-abuse.htm" target="_blank">According to the CDC</a>\r\n\r\nStudies have shown that, when compared with the general population, gay and bisexual men, lesbian, and transgender individuals are more likely to:\r\n<ul>\r\n	<li>Use alcohol and drugs,</li>\r\n	<li>Have higher rates of substance abuse,</li>\r\n	<li>Not withhold from alcohol and drug use, and</li>\r\n	<li>Continue heavy drinking into later life.</li>\r\n</ul>'),
(2000, 112, '_substance_abuse_top', 'field_56bdbae334f17'),
(2001, 112, 'substance_abuse_bottom', 'For some gay and bisexual men, alcohol and illegal drug use, especially methamphetamines, amyl nitrates, and drugs used to treat erectile dysfunction, also contribute to a higher chance of getting HIV and other STDs. Persons using drugs or alcohol may also raise their chances of getting HIV or giving it to others by getting involved in more risky sexual practices and behaviors or through sharing needles or other injection equipment.\r\n\r\nIf you or someone you know has a problem with alcohol or drug addiction and needs help, go to <a href="https://findtreatment.samhsa.gov" target="_blank"> Substance Abuse Treatment Facility Locator</a> or call 800-662-Help (4357).'),
(2002, 112, '_substance_abuse_bottom', 'field_56bdbb2d34f18'),
