(2504, 116, 'additional_health_multy_link_area_3_multy_link_description', 'The Society for the Advancement of Sexual Health (SASH) offers hope and valuable resources to those seeking information about sexual addiction. If you wish, you can take a self-scoring test on sexual addiction. If you have come here looking for a therapist for the treatment of sex addiction, our professional members may be able to help you.'),
