(2559, 116, '_additional_health_multy_link_area_10_multy_link_heading', 'field_56bdbef05979a'),
(2560, 116, 'additional_health_multy_link_area_10_multy_link_description', 'The Coalition is committed to improving the health and well-being of lesbian, gay, bisexual, and transgender individuals through federal and local advocacy, education, and research. The Coalition addresses the entire LGBT community, including individuals of every sexual orientation, gender, gender identity, race, ethnicity, and age regardless of disability, income, education, and geography. The Coalition is an initiative of HealthHIV, a national nonprofit focused on health equity.'),
(2561, 116, '_additional_health_multy_link_area_10_multy_link_description', 'field_56bdbf1d5979b'),
