(2813, 131, 'sub_heading', 'Resources to stay healthy and safe'),
(2814, 131, '_sub_heading', 'field_56bdb862de949'),
(2815, 131, 'saftey_tips_area', '<h2>SAFTEY TIPS</h2>\r\nLOOKING doesn''t provide background checks on our members or subscribers and though we take steps to protect our members, ultimately, your online and offline safety is your responsibility and should be your top priority. Remember, take your time, dont rush into things, and always trust your gut instincts when it comes to making choices of who you meet.\r\n<h3>Be Anonymous</h3>\r\nDon''t include your last name or any other identifying information such as your phone number, home address, email address, place of work, or other sensitive personal information, in your profile or initial communications.You might also want a use a service like Google Voice, Grasshopper, or Line2, which allows you to give people a second phone number and the ability to block them easily.\r\n<h3>Report Suspicious or Inappropriate Behavior</h3>\r\nRemember that people aren''t always what they seem. If you suspect that someone you''re talking to may be a scammer, or is conducting himself in an inappropriate way, stop your communications and immediately report him. To report or block a member, visit his profile and select the triangle with explanation mark, on the bottom of his screen, or by contacting us at <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a>\r\n<h3>Other Users May be Able to Determine Your Location</h3>\r\nLOOKING uses your mobile devices location to allow you to identify the relative distance to others, and for others to identify your relative distance from them. If you want to keep you location private from other users go to Settings and select Hide Distance.\r\n<h3>Travel Advisory</h3>\r\nBe careful when you travel and be aware of the local laws. Sexual acts between consenting adult males are criminalized in many regions throughout the world. The death penalty can be imposed for same-sex intimacy in eight countries. For more information and a complete list of these countries, please visit: <a href="http://76crimes.com/76-countries-where-homosexuality-is-illegal/" target="_blank">Countries Where Homosexuality is Illegal</a>'),
(2816, 131, '_saftey_tips_area', 'field_56bdb9309c8e9'),
(2817, 131, 'health_quote_1', '"Substance use, abuse, and dependence has been closely associated with HIV infection since the beginning of the epidemic."'),
(2818, 131, '_health_quote_1', 'field_56bdb9fd77de6'),
(2819, 131, 'substance_abuse_heading', 'SUBSTANCE ABUSE'),
(2820, 131, '_substance_abuse_heading', 'field_56bdbac134f16'),
(2821, 131, 'substance_abuse_top', '<a href="http://www.cdc.gov/msmhealth/substance-abuse.htm" target="_blank">According to the CDC</a>\r\n\r\nStudies have shown that, when compared with the general population, gay and bisexual men, lesbian, and transgender individuals are more likely to:\r\n<ul>\r\n	<li>Use alcohol and drugs,</li>\r\n	<li>Have higher rates of substance abuse,</li>\r\n	<li>Not withhold from alcohol and drug use, and</li>\r\n	<li>Continue heavy drinking into later life.</li>\r\n</ul>'),
(2822, 131, '_substance_abuse_top', 'field_56bdbae334f17'),
(2823, 131, 'substance_abuse_bottom', 'For some gay and bisexual men, alcohol and illegal drug use, especially methamphetamines, amyl nitrates, and drugs used to treat erectile dysfunction, also contribute to a higher chance of getting HIV and other STDs. Persons using drugs or alcohol may also raise their chances of getting HIV or giving it to others by getting involved in more risky sexual practices and behaviors or through sharing needles or other injection equipment.\r\n\r\nIf you or someone you know has a problem with alcohol or drug addiction and needs help, go to <a href="https://findtreatment.samhsa.gov" target="_blank"> Substance Abuse Treatment Facility Locator</a> or call 800-662-Help (4357).'),
(2824, 131, '_substance_abuse_bottom', 'field_56bdbb2d34f18'),
(2825, 131, 'health_quote_2', '"PrEP together with other HIV prevention tools, will make it possible for us to dramatically reduce new HIV infections."'),
(2826, 131, '_health_quote_2', 'field_56bdba4f43a9b'),
(2827, 131, 'hiv_heading', 'HIV RISKS AND RESOURCES'),
(2828, 131, '_hiv_heading', 'field_56bdbca517dd3'),
(2829, 131, 'hiv_content_area', '<a class="class_underline" href="http://www.cdc.gov/hiv/group/msm" target="_blank">According to the CDC</a>\r\n<ul>\r\n	<li>Gay and bisexual men are more severely affected by HIV than any other group in the United States.</li>\r\n	<li>Among all gay and bisexual men, African American gay and bisexual men bear a burden of HIV.</li>\r\n	<li>From 2008 to 2010, HIV infections among young African American gay and bisexual men increased 20%.</li>\r\n</ul>\r\nSexual risk behaviors account for most HIV infections in gay and bisexual men. Most gay and bisexual men acquire HIV through anal sex, which is the riskiest type of sex for getting or transmitting HIV. For sexually active gay and bisexual men, the most effective ways to prevent transmitting or becoming infected with HIV are to be on antiretroviral medications (to either treat or prevent infection) and to correctly use a condom every time for anal or vaginal sex. Gay men are at increased risk for sexually transmitted diseases (STDs), like syphilis, gonorrhea, and chlamydia, and CDC recommends that all sexually active gay and bisexual be tested at least annually for these infections and obtain treatment, if necessary.\r\n\r\nHaving more sex partners compared to other men means gay and bisexual men have more opportunities to have sex with someone who can transmit HIV or another STD. Similarly, among gay men, those who have more partners are more likely to acquire HIV.\r\n\r\nTo find fast, free, and confidential HIV and STD testing location near you visit: <a href="https://gettested.cdc.gov" target="_blank">Get Tested</a> Many of the large chain drug stores offer a selection of over-the-counter HIV test kits for home use. To learn more about confidential, at-home HIV and STD testing please visit this link: <a href="https://www.stdrapidtestkits.com" target="_blank">STD Rapid Test Kits </a>'),
(2830, 131, '_hiv_content_area', 'field_56bdbcdc17dd4'),
