(5112, 254, 'advertising_area', '<h2>ADVERTISING</h2>\r\nWant to advertise on LOOKING app or submit an event to promote? We have many options to choose from. Whether you want to target customers in your neighborhood or around the world, LOOKING is the ideal way to reach highly engaged gay men. Whether you have a restaurant or bar looking to highlight a special night or a retail business seeking new clientele nearby, LOOKING is the most efficient way to talk directly to local customers. Is your business more global or Internet-based? National advertising campaigns are an efficient way to reach LOOKING users across your country and around the world.\r\n\r\nContact us at <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a>'),
(5113, 254, '_advertising_area', 'field_56bda6e993e2e'),
