(5116, 254, 'partenrships_and_events_area', '<h2>PARTNERSHIPS AND EVENTS</h2>\r\nWe are always looking for profit and nonprofit organizations and events to partner with.\r\nPlease send an inquiry with details to: <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a>'),
(5117, 254, '_partenrships_and_events_area', 'field_56bda77ba20c3'),
(5118, 254, 'press_content_area', '<h2>PRESS</h2>\r\nSince its founding in 2009, Grindrs exploding popularity and its innovation in location-based social networking has captivated the press both in the U.S. and abroad. From The New York Times to The Guardian U.K., the biggest deals in news have been dropping the Grindr name. Check out the links below, or download the Grindr press kit. Want to write about Daddyhunt the app?\r\n\r\nContact us at <a href="mailto:support@daddyhunt.com">support@daddyhunt.com</a>'),
