(8720, 313, 'partenrships_and_events_area', '<h2>PARTNERSHIPS AND EVENTS</h2>\r\nWe are always looking for profit and nonprofit organizations and events to partner with.\r\nPlease send an inquiry with details to: <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a>'),
(8721, 313, '_partenrships_and_events_area', 'field_56bda77ba20c3'),
(8722, 313, 'press_content_area', '<h2>PRESS</h2>\r\nLOOKING''S popularity has captured the attention of the press, both in the U.S. and abroad. Many print and online media agencies have been dropping the Looking name.\r\n\r\nIf you are interested in writing a story about LOOKING, please email us at: <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a>'),
(8723, 313, '_press_content_area', 'field_56bda8e8706b1'),
