(208, 1, '2016-03-28 07:36:06', '2016-03-28 07:36:06', 'Your profile photo is usually the first impression people have of you on LOOKING. Its important to pick a photo that represents you well and a significant portion of you must appear somewhere in the photo.\n<h5>When choosing your profile photo, consider these helpful tips:</h5>\n<ul>\n	<li><strong>Use our verified photo feature</strong></li>\n	<li><strong>Use a clear, recent face photo</strong></li>\n	<li><strong>Use photos of you, and only you</strong></li>\n</ul>\n<h3>Prohibited Profile Photos</h3>\n<ul>\n	<li>Nudity or pornography</li>\n	<li>Sexually suggestive or explicit photos</li>\n	<li>Photos of any obscene gestures and/or lewd behavior</li>\n	<li>Photos displaying genitals, erections, tenting, exposed buttocks, or pubic hair</li>\n	<li>Photos that have been altered to disguise sexual acts either real, illustrated, or simulated</li>\n	<li>Nudity (particularly the genitals) covered up by a hand, towel, hat or other means is not allowed</li>\n	<li>Underwear photos. Swimwear is allowed, but no pubic hair, no outline of genitals, and no portion of the buttocks can be present</li>\n</ul>\n<ul>\n	<li>Pants and shorts must be worn normally, buttoned, and not pulled or hanging down</li>\n	<li>Grabbing, holding or touching genitals or genital area</li>\n	<li>Images that display semen or any fluid made to look like ejaculation or semen</li>\n	<li>Photos with sheer or see-through or wet material below the waist</li>\n	<li>Crotch or buttocks area only photos</li>\n	<li>Photos that contain sex props and toys, real or mimicked</li>\n	<li>Images of anyone under 18 years of age</li>\n	<li>Copyrighted illustrations, images, trademarked images, and any images that you do not own</li>\n	<li>Images of models, celebrities, sports teams, or miscellaneous photos downloaded from the web</li>\n	<li>Drug use, drug paraphernalia, or illegal activity</li>\n	<li>Images of firearms or weapons</li>\n	<li>Violence of any kind, including blood in photos</li>\n	<li>Image used to advertise services, goods, events, websites, or apps</li>\n	<li>Photos of pets or other animals unless you are also in the photo</li>\n	<li>Images of any non-LOOKING users</li>\n	<li>No impersonation. Members found using someone else''s picture as their own will be permanently removed from LOOKING</li>\n</ul>\n<h3>Prohibited Profile Text</h3>\n<ul>\n	<li>Profanity or curse words</li>\n	<li>Text that incites racism, bigotry, hatred or physical harm of any kind</li>\n	<li>Text referring to genital size/description or sexual acts</li>\n	<li>Personal contact information including phone numbers, email addresses, home address, or any similar information</li>\n	<li>Sexually explicit or overly suggestive text</li>\n	<li>Mention of illegal drugs</li>\n	<li>Advertising of services, goods, events, websites or apps. This includes escort services and the basic mention of massages</li>\n</ul>\n<h3>External Links</h3>\nLinks to your Facebook, Twitter, YouTube, or LinkedIn profiles are allowed. The content of external links must adhere to the guidelines above, or they will be removed. Links to personal websites or small businesses are generally allowed provided they adhere to the guidelines above. Links to and language about messaging services other than those listed above are prohibited and will be removed.\n<h3>Notice:</h3>\nAny violation of the above guidelines could result in a permanent ban from LOOKING. Profiles are subjected to review by the LOOKING administrators and may be edited or deleted, at our discretion, if they do not comply. We dont monitor outside activity of our app users, please be and smart if you meet guys in person.\n\nIf your profile is blocked and you believe it has been done in error, please email us at <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a> and include a photo of your government issued ID in order to verify your identity.', 'PROFILE GUIDELINES', '', 'inherit', 'closed', 'closed', '', '74-autosave-v1', '', '', '2016-03-28 07:36:06', '2016-03-28 07:36:06', '', 74, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//archives/208', 0, 'revision', '', 0),
