(223, 1, '2016-03-31 08:16:38', '2016-03-31 08:16:38', '<p>To reset your password, simply select Forgot Password from the login page and enter your email address. Looking will email you a request to reset your password. Lookings communications may occasionally get blocked. If you dont receive your email to reset your password check your spam/junk folder. Please add <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a> to your safe senders list.  CHECK THIS > (How does this process work? Is a temporary password sent to the user and then can he change it?)   If you''ve forgotten your password, you may request a temporary password by following the link on the log-in page. After using the temporary password to log in, remember to change your password in the account section to something you will remember. </p>', 'I forgot my password. What should I do?', '', 'publish', 'closed', 'closed', '', 'heading1', '', '', '2016-03-31 09:51:42', '2016-03-31 09:51:42', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=223', 0, 'hrf_faq', '', 0),
(224, 1, '2016-03-31 08:16:47', '2016-03-31 08:16:47', '<P>Your email address is the only way to verify account ownership. If youve forgotten or no longer have access to the email address you created your Looking account with, you cannot recover your account.</P>', 'I forgot my email and I can''t access my account. What can I do?', '', 'publish', 'closed', 'closed', '', 'h2', '', '', '2016-03-31 09:52:13', '2016-03-31 09:52:13', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=224', 0, 'hrf_faq', '', 0),
