(228, 1, '2016-03-31 09:11:52', '2016-03-31 09:11:52', '<ul>\r\n<li>Open the Looking app</li>\r\n<li>Select the Settings icon in the top right corner of the screen.</li>\r\n<li>Select Edit Profile.</li>\r\n<li>Select Email.</li>\r\n<li>Enter your new email address and click Done.</li>\r\n</ul>\r\n<p> CHECK THIS > A confirmation email will be sent to the email address you provided. Click on the link in the email to confirm your new email address??</p>', 'How do I change my email address?', '', 'publish', 'closed', 'closed', '', 'how-do-i-change-my-email-address', '', '', '2016-03-31 09:11:52', '2016-03-31 09:11:52', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=228', 0, 'hrf_faq', '', 0),
(229, 1, '2016-03-31 09:13:35', '2016-03-31 09:13:35', 'Premium members can access the following features: (This list is subject to change)\r\n<ul>\r\n	<li>Unrestricted access to Looking and Dating sections</li>\r\n	<li>No banner advertisements</li>\r\n	<li>View 500+ profiles where available</li>\r\n	<li>More filter options</li>\r\n	<li>Unlock and save additional private photos</li>\r\n	<li>Unlimited Favorites and Blocks</li>\r\n	<li>Saved phrases</li>\r\n	<li>Access entire chat history</li>\r\n	<li>Un-send messages</li>\r\n	<li>Cascade swipe</li>\r\n</ul>', 'I want to upgrading to Looking Premium. What are the features?', '', 'publish', 'closed', 'closed', '', 'i-want-to-upgrading-to-looking-premium-what-are-the-features', '', '', '2016-04-11 10:53:33', '2016-04-11 10:53:33', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=229', 0, 'hrf_faq', '', 0),
(230, 1, '2016-03-31 09:13:59', '2016-03-31 09:13:59', '<p>To cancel your subscription, please turn off the automatic renewal of your subscription through the Apple App Store or iTunes. After the automatic renewal of your subscription is turned off, you will not be billed for any further subscription renewals, but you will continue to receive access to your subscription until your current subscription period expires.</p>', 'How do I cancel my Looking Premium subscription?', '', 'publish', 'closed', 'closed', '', 'how-do-i-cancel-my-looking-premium-subscription', '', '', '2016-03-31 09:13:59', '2016-03-31 09:13:59', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=230', 0, 'hrf_faq', '', 0),
(231, 1, '2016-03-31 09:14:42', '2016-03-31 09:14:42', '<p>The first thing to try is to restart the app or log out and sign back in. Be sure to fully end the process - don''t just minimize the app. If you''re still having trouble, get in touch with us at <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a></p>', 'I subscribed to Looking Premium, but none of the premium features have been enabled. What should I do?', '', 'publish', 'closed', 'closed', '', 'i-subscribed-to-looking-premium-but-none-of-the-premium-features-have-been-enabled-what-should-i-do', '', '', '2016-03-31 09:14:46', '2016-03-31 09:14:46', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=231', 0, 'hrf_faq', '', 0),
(232, 1, '2016-03-31 09:15:34', '2016-03-31 09:15:34', '<p>Looking servers may be temporarily unavailable. E-mail <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a> for assistance. </p>', 'I can''t log into my account, I can''t view pictures or messages seem to not be sending. Whats going on?', '', 'publish', 'closed', 'closed', '', 'i-cant-log-into-my-account-i-cant-view-pictures-or-messages-seem-to-not-be-sending-whats-going-on', '', '', '2016-03-31 09:15:34', '2016-03-31 09:15:34', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=232', 0, 'hrf_faq', '', 0),
(233, 1, '2016-03-31 09:15:59', '2016-03-31 09:15:59', '<p>If the app is unable to determine a location for you or another member, then we likely default the profile to the Los Angeles area to ensure stability. Location errors may occur if the location preferences are not specifically enabled for an app, if the mobile device fails to retrieve a valid GPS fix, or if a user logs in using Wi-Fi.</p>', 'Why are the distances so far off on some profiles?', '', 'publish', 'closed', 'closed', '', 'why-are-the-distances-so-far-off-on-some-profiles', '', '', '2016-03-31 09:15:59', '2016-03-31 09:15:59', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=233', 0, 'hrf_faq', '', 0),
(234, 1, '2016-03-31 09:16:46', '2016-03-31 09:16:46', '<p>If you experience a crash within your app, please contact  <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a> Please provide details steps to reproduce the problem along with the version of your device''s operating system, what type of hardware you have Looking installed on, and the version of Looking you are currently running.   CHECK THIS > Is this correct?</p>', 'What can I do if the app crashes on me?', '', 'publish', 'closed', 'closed', '', 'what-can-i-do-if-the-app-crashes-on-me', '', '', '2016-03-31 09:16:46', '2016-03-31 09:16:46', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=234', 0, 'hrf_faq', '', 0),
(235, 1, '2016-03-31 09:17:13', '2016-03-31 09:17:13', '<p>Hold your finger down on the app icon until it begins shaking and a small X appears in the top corner of the app icon. Then tap that X to uninstall it, and confirm the pop-up message. Youll then be able to download Looking again from the iTunes App Store to use it again.</p>', 'How do I delete the app?', '', 'publish', 'closed', 'closed', '', 'how-do-i-delete-the-app', '', '', '2016-03-31 09:17:13', '2016-03-31 09:17:13', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=235', 0, 'hrf_faq', '', 0),
(236, 1, '2016-03-31 09:17:35', '2016-03-31 09:17:35', '<p>Select the Settings icon in the top right corner of the screen then tap the Logout button in the upper right-hand corner of the Settings screen.</p>', 'How do I Iog out of Looking?', '', 'publish', 'closed', 'closed', '', 'how-do-i-iog-out-of-looking', '', '', '2016-03-31 09:17:35', '2016-03-31 09:17:35', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=236', 0, 'hrf_faq', '', 0),
(237, 1, '2016-03-31 09:17:57', '2016-03-31 09:17:57', '<p>You may only create and use one account at a time. If multiple accounts are detected, we will delete all accounts except for the one with the most recent activity. In turn your device will be blacklisted, and you will not be able to use Looking for at least 30 days. </p>', 'Can I have more than one account?', '', 'publish', 'closed', 'closed', '', 'can-i-have-more-than-one-account', '', '', '2016-03-31 09:17:57', '2016-03-31 09:17:57', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=237', 0, 'hrf_faq', '', 0),
(238, 1, '2016-03-31 09:18:47', '2016-03-31 09:18:47', '<p>Each Looking profile is associated with a particular iPhone. If you would like us to migrate your old profile to your new device please contact us at <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a>.</p>', 'What happens to my profile if I get a new phone?', '', 'publish', 'closed', 'closed', '', 'what-happens-to-my-profile-if-i-get-a-new-phone', '', '', '2016-03-31 09:18:47', '2016-03-31 09:18:47', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=238', 0, 'hrf_faq', '', 0),
(239, 1, '2016-03-31 09:19:42', '2016-03-31 09:19:42', '<p>Each Looking profile is associated with a particular iPhone. If you would like us to delete your old profile please contact us at <a href="mailto:support@lookingmobileapp.com">support@lookingmobileapp.com</a>.</p>', 'How do I have a duplicate profile deleted, from an old phone, for example?', '', 'publish', 'closed', 'closed', '', 'how-do-i-have-a-duplicate-profile-deleted-from-an-old-phone-for-example', '', '', '2016-03-31 09:19:42', '2016-03-31 09:19:42', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=239', 0, 'hrf_faq', '', 0),
(240, 1, '2016-03-31 09:21:55', '2016-03-31 09:21:55', '<p>It''s a violation of our Terms of Service to access multiple accounts on one device. You risk deletion of your account by allowing someone else to use Looking on your device. Only you should be using Looking on your device.</p>', 'Should I let other members use Looking on my device?', '', 'publish', 'closed', 'closed', '', 'should-i-let-other-members-use-looking-on-my-device', '', '', '2016-03-31 09:21:55', '2016-03-31 09:21:55', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=240', 0, 'hrf_faq', '', 0),
(241, 1, '2016-03-31 09:22:15', '2016-03-31 09:22:15', '<p>To stop sound notifications, select the Settings icon in the top right corner of the app screen then turn the Mute Sounds toggle switch to the off position. From the iPhone main screen, click Settings >Notifications >Looking and make sure both sound and vibrate notifications are disabled.</p>', 'How do I turn off notifications on the app?', '', 'publish', 'closed', 'closed', '', 'how-do-i-turn-off-notifications-on-the-app', '', '', '2016-03-31 09:22:15', '2016-03-31 09:22:15', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=241', 0, 'hrf_faq', '', 0),
(242, 1, '2016-03-31 09:22:42', '2016-03-31 09:22:42', '<p>If you are not receiving push notifications, please verify that you have push notifications enabled. From the iPhone main screen, click Settings >Notifications >Looking and make sure both notifications are enabled.</p>', 'I am not getting push notifications', '', 'publish', 'closed', 'closed', '', 'i-am-not-getting-push-notifications', '', '', '2016-03-31 09:22:42', '2016-03-31 09:22:42', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=242', 0, 'hrf_faq', '', 0),
(243, 1, '2016-03-31 09:23:07', '2016-03-31 09:23:07', '<p>Go into Settings for your device. From the main screen, select Privacy, then Photos, and turn on the button next to the Looking app icon.\r\n</p>', 'How do I adjust the privacy settings for attaching photos in a message?', '', 'publish', 'closed', 'closed', '', 'how-do-i-adjust-the-privacy-settings-for-attaching-photos-in-a-message', '', '', '2016-03-31 09:24:33', '2016-03-31 09:24:33', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=243', 0, 'hrf_faq', '', 0),
(244, 1, '2016-03-31 09:26:19', '2016-03-31 09:26:19', '<ul>\r\n	<li>Check your Internet connection. The most common explanation for this problem is a slow or unreliable Internet connection.</li>\r\n	<li>Resize your picture. All pictures must be larger than 200px by 200px. If your photo is too small, you must resize it.  CHECK THIS &gt; Is this true?</li>\r\n	<li>Uninstall and then reinstall the app (this is not the same as deleting your Looking account).</li>\r\n	<li>Try uploading a picture from a different source (for example, select a picture from your phone''s photo gallery rather than camera or vice versa).</li>\r\n	<li>Looking servers may be temporarily unavailable. If this is the case, please try uploading your picture(s) in an hour.</li>\r\n</ul>', 'I''m having trouble uploading pictures. What can I do?', '', 'publish', 'closed', 'closed', '', 'im-having-trouble-uploading-pictures-what-can-i-do', '', '', '2016-04-11 10:51:27', '2016-04-11 10:51:27', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=244', 0, 'hrf_faq', '', 0),
(245, 1, '2016-03-31 09:27:19', '2016-03-31 09:27:19', 'Here are some of the most common reasons why your photo was rejected:\r\n<ul>\r\n	<li>People other than yourself are visible in the photo.</li>\r\n	<li>There''s a website or copyright imprint embedded in the photo.</li>\r\n	<li>It violates our photo guidelines.</li>\r\n</ul>', 'Why was my photo rejected?', '', 'publish', 'closed', 'closed', '', 'why-was-my-photo-rejected', '', '', '2016-04-11 10:49:49', '2016-04-11 10:49:49', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=245', 0, 'hrf_faq', '', 0),
(246, 1, '2016-03-31 09:27:44', '2016-03-31 09:27:44', '<p>Yes. You can find it on the settings tab.</p>', 'Is there a metric setting option?', '', 'publish', 'closed', 'closed', '', 'is-there-a-metric-setting-option', '', '', '2016-03-31 09:27:44', '2016-03-31 09:27:44', '', 0, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//?post_type=hrf_faq&#038;p=246', 0, 'hrf_faq', '', 0),
(247, 1, '2016-03-31 09:51:39', '2016-03-31 09:51:39', '<P>Your email address is the only way to verify account ownership. If youve forgotten or no longer have access to the email address you created your Looking account with, you cannot recover your account.</P>', 'I forgot my password. What should I do?', '', 'inherit', 'closed', 'closed', '', '223-autosave-v1', '', '', '2016-03-31 09:51:39', '2016-03-31 09:51:39', '', 223, 'http://lookingapp.debutinfotech.com/App/app/webroot/looking//archives/247', 0, 'revision', '', 0),
