(537, 1500972265, 'new', 'wfUpgrade', 1, '7e6713c14897b8d5cc7c0ab5939d9d52', '7e6713c14897b8d5cc7c0ab5939d9d52', 'Your WordPress version is out of date', 'WordPress version 4.8 is now available. Please upgrade immediately to get the latest security updates from WordPress.', 'a:2:{s:14:"currentVersion";s:5:"4.4.7";s:10:"newVersion";s:3:"4.8";}'),
