(539, 1500972265, 'new', 'wfPluginUpgrade', 2, 'ec17f346ecb0083e7a918d366baf03fd', 'ec17f346ecb0083e7a918d366baf03fd', 'The Plugin "Akismet" needs an upgrade (3.1.7 -> 3.3.3).', 'You need to upgrade "Akismet" to the newest version to ensure you have any security fixes the developer has released.', 'a:16:{s:4:"Name";s:7:"Akismet";s:9:"PluginURI";s:19:"http://akismet.com/";s:7:"Version";s:5:"3.1.7";s:11:"Description";s:499:"Used by millions, Akismet is quite possibly the best way in the world to <strong>protect your blog from spam</strong>. It keeps your site protected even while you sleep. To get started: 1) Click the &#8220;Activate&#8221; link to the left of this description, 2) <a href="http://akismet.com/get/">Sign up for an Akismet plan</a> to get an API key, and 3) Go to your Akismet configuration page, and save your API key. <cite>By <a href="http://automattic.com/wordpress-plugins/">Automattic</a>.</cite>";s:6:"Author";s:65:"<a href="http://automattic.com/wordpress-plugins/">Automattic</a>";s:9:"AuthorURI";s:40:"http://automattic.com/wordpress-plugins/";s:10:"TextDomain";s:7:"akismet";s:10:"DomainPath";s:0:"";s:7:"Network";b:0;s:5:"Title";s:41:"<a href="http://akismet.com/">Akismet</a>";s:10:"AuthorName";s:10:"Automattic";s:10:"pluginFile";s:91:"/home/lookingapp/public_html/App/app/webroot/looking/wp-content/plugins/akismet/akismet.php";s:10:"newVersion";s:5:"3.3.3";s:4:"slug";s:7:"akismet";s:5:"wpURL";s:37:"https://wordpress.org/plugins/akismet";s:20:"vulnerabilityPatched";b:0;}'),
(540, 1500972265, 'new', 'wfPluginUpgrade', 2, 'd9573c96f2f0def511a574810cfb91d4', 'd9573c96f2f0def511a574810cfb91d4', 'The Plugin "HTML5 Responsive FAQ" needs an upgrade (2.5 -> 2.5.3).', 'You need to upgrade "HTML5 Responsive FAQ" to the newest version to ensure you have any security fixes the developer has released.', 'a:16:{s:4:"Name";s:20:"HTML5 Responsive FAQ";s:9:"PluginURI";s:31:"http://www.indatos.com/?ref=faq";s:7:"Version";s:3:"2.5";s:11:"Description";s:190:"HTML5 Responsive FAQ plugin makes it easy for you to FAQs on your site. Fully compatible with all responsive themes. <cite>By <a href="http://www.indatos.com/?ref=faq">Aman Verma</a>.</cite>";s:6:"Author";s:56:"<a href="http://www.indatos.com/?ref=faq">Aman Verma</a>";s:9:"AuthorURI";s:31:"http://www.indatos.com/?ref=faq";s:10:"TextDomain";s:0:"";s:10:"DomainPath";s:0:"";s:7:"Network";b:0;s:5:"Title";s:66:"<a href="http://www.indatos.com/?ref=faq">HTML5 Responsive FAQ</a>";s:10:"AuthorName";s:10:"Aman Verma";s:10:"pluginFile";s:117:"/home/lookingapp/public_html/App/app/webroot/looking/wp-content/plugins/html5-responsive-faq/html5-responsive-faq.php";s:10:"newVersion";s:5:"2.5.3";s:4:"slug";s:20:"html5-responsive-faq";s:5:"wpURL";s:50:"https://wordpress.org/plugins/html5-responsive-faq";s:20:"vulnerabilityPatched";b:0;}'),
(541, 1500972265, 'new', 'wfPluginUpgrade', 2, '11aba704e15b6832eac660d2ab628f18', '11aba704e15b6832eac660d2ab628f18', 'The Plugin "Wordfence Security" needs an upgrade (6.3.1 -> 6.3.15).', 'You need to upgrade "Wordfence Security" to the newest version to ensure you have any security fixes the developer has released.', 'a:16:{s:4:"Name";s:18:"Wordfence Security";s:9:"PluginURI";s:25:"http://www.wordfence.com/";s:7:"Version";s:5:"6.3.1";s:11:"Description";s:131:"Wordfence Security &#8211; Anti-virus, Firewall and Malware Scan <cite>By <a href="http://www.wordfence.com/">Wordfence</a>.</cite>";s:6:"Author";s:49:"<a href="http://www.wordfence.com/">Wordfence</a>";s:9:"AuthorURI";s:25:"http://www.wordfence.com/";s:10:"TextDomain";s:0:"";s:10:"DomainPath";s:0:"";s:7:"Network";b:1;s:5:"Title";s:58:"<a href="http://www.wordfence.com/">Wordfence Security</a>";s:10:"AuthorName";s:9:"Wordfence";s:10:"pluginFile";s:95:"/home/lookingapp/public_html/App/app/webroot/looking/wp-content/plugins/wordfence/wordfence.php";s:10:"newVersion";s:6:"6.3.15";s:4:"slug";s:9:"wordfence";s:5:"wpURL";s:39:"https://wordpress.org/plugins/wordfence";s:20:"vulnerabilityPatched";b:0;}'),
